cheduler - INFO - Close client connection: Client-a9266142-7a2c-11ed-8473-080038b51596&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Remove client Client-a92819ad-7a2c-11ed-9e51-080038b558dc&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Close client connection: Client-a9280251-7a2c-11ed-8474-080038b51596&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Close client connection: Client-a9265c51-7a2c-11ed-9e50-080038b558dc&lt;/p&gt;\n    \n\n    \n        &lt;p style=\"font-family: monospace; margin: 0;\"&gt;distributed.scheduler - INFO - Close client connection: Client-a92819ad-7a2c-11ed-9e51-080038b558dc&lt;/p&gt;\n    \n"},"id":"1400","type":"Div"},{"attributes":{"dimensions":"width"},"id":"1301","type":"PanTool"},{"attributes":{},"id":"1290","type":"LinearScale"},{"attributes":{},"id":"1447","type":"CategoricalTickFormatter"},{"attributes":{"axis":{"id":"1292"},"coordinates":null,"group":null,"ticker":null},"id":"1295","type":"Grid"},{"attributes":{},"id":"1013","type":"BasicTicker"},{"attributes":{"callback":null},"id":"1056","type":"TapTool"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1276","type":"Line"},{"attributes":{"child":{"id":"1003"},"title":"Worker Profile (compute)"},"id":"1403","type":"Panel"},{"attributes":{"style":{"border":"1px solid lightgray","box-shadow":"inset 1px 0 8px 0 lightgray","height":"100%","max-height":"1080px","max-width":"1920px","overflow":"auto","padding":"12px","width":"100%"},"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 51.10 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 1609 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 350.79 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 69.43 s &lt;/li&gt;\n&lt;li&gt; transfer time: 39.04 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.0.160:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 16 &lt;/li&gt;\n          &lt;li&gt; Threads: 384 &lt;/li&gt;\n          &lt;li&gt; Memory: 2.70 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1451","type":"CategoricalTickFormatter"},{"attributes":{},"id":"1008","type":"LinearScale"},{"attributes":{"tools":[{"id":"1020"},{"id":"1021"},{"id":"1022"},{"id":"1023"},{"id":"1036"}]},"id":"1025","type":"Toolbar"},{"attributes":{},"id":"1297","type":"BasicTicker"},{"attributes":{"axis":{"id":"1016"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1019","type":"Grid"},{"attributes":{"child":{"id":"1075"},"title":"Worker Profile (administrative)"},"id":"1404","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"1438"},"group":null,"major_label_policy":{"id":"1439"},"ticker":{"id":"1085"},"visible":false},"id":"1084","type":"LinearAxis"},{"attributes":{},"id":"1023","type":"ResetTool"},{"attributes":{},"id":"1053","type":"BasicTicker"},{"attributes":{"child":{"id":"1401"},"title":"Summary"},"id":"1402","type":"Panel"},{"attributes":{},"id":"1300","type":"ResetTool"},{"attributes":{},"id":"1082","type":"LinearScale"},{"attributes":{},"id":"1059","type":"ResetTool"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"coordinates":null,"group":null,"text":"Bandwidth"},"id":"1283","type":"Title"},{"attributes":{},"id":"1432","type":"BasicTickFormatter"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt
